import json

from pylab import *


def binary_to_dict(binary):
    inp = str()
    prev = ''
    i = 0
    while prev != '}':
        temp = str(binary[i * 8: i * 8 + 8])
        temp = int(temp, 2)
        temp = chr(temp)
        inp += temp
        prev = temp
        i += 1

    return inp


def string_to_ascii(dictionary):
    out_bin = str()
    for c in dictionary:
        temp = ord(c)
        temp = '{0:08b}'.format(ord(c))
        out_bin += temp

    return out_bin


def remove_spaces(dict):
    between = False

    for i, elem in enumerate(dict):
        if elem == '(':
            between = False
        elif elem == ')':
            between = True
        elif elem == ',' and between:
            dict = dict[:i] + ' ' + dict[i + 1:]

    return dict


def decompress_dict_modular(dictionary):
    # dictionary = binary_to_dict(binary)
    dictionary = dictionary[1:-1]

    l = dictionary.split(' ')

    out = '{'
    for elem in l:
        left, right = elem.split(':')

        if ',' in left:
            left = '\"(' + left + ')\"'
        else:
            left = '\"' + left + '\"'

        right = '\"(' + right + ')\"'

        out += left + ':' + right + ','

    out = out[:-1] + '}'

    dictionary = json.loads(out)

    return dictionary


def compress_dict_modular(dictionary):
    dictionary = dictionary.replace('\'', '')
    dictionary = dictionary.replace(': ', ':')
    dictionary = dictionary.replace(', ', ',')
    dictionary = remove_spaces(dictionary)
    dictionary = dictionary.replace('(', '')
    dictionary = dictionary.replace(')', '')

    binary = string_to_ascii(dictionary)

    return binary


